import React from 'react'
import Table from './Table'

const GnG = () => {
    const racks =
    {
        server: ["test1", "test2"],
        network_1: ["test1", "test2"],
        network_2: ["test1", "test2"],
        storage: ["test1", "test2"],
        peripheral: ["test1", "test2"]
    }

    return (
        <div className='flex mx-2 border-r border-black mt-10'>

            <Table rack={racks[server]}/>
            <Table rack={racks[network_1]}/>
            <Table rack={racks[network_2]}/>
            <Table rack={racks[storage]}/>
            <Table rack={racks[peripheral]}/>

        </div>

    )
}

export default GnG
